Input: When the following equation is balanced, which of the following is true?
__ MnO4− + __ I− + __ H+ <-> __ Mn2+ + __ IO3− + __ H2O Choices: a) The I− : IO3− ratio is 3:1. b) The MnO4- : I- ratio is 6:5. c) The MnO4- : Mn2+ ratio is 3:1. d) The H+ : I− ratio is 2:1. 
Output: {'sol': 'b'}
